import React from "react";

export default function Phonetic(props) {
    console.log(props.phonetic);
    return (
      <div className="phonetics">
        <a href={props.phonetics.audio} target="blank">
          Listen
        </a>
        <br />
        {props.phonetics.text}
      </div>
    );
}
